import { Button } from "primereact/button";

const ButtonLabel = ({ action, icon, labelText, disabled }) => {
  return (
    <Button
    label={labelText}
    icon={`pi pi-${icon}`}
    className="p-button-help"
    onClick={() => action()}
    {...{disabled}}
    />
  );
};

export default ButtonLabel;
